import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';



const Icon = (props) => {

  return (
    <div style={{width: 20, height: 20,margin: 5, display: 'flex'}}>
        <FontAwesomeIcon   style={{fontSize: 10}}  {...props}/>
    </div> 
  );
}

export default Icon;
